import React, { Component } from 'react';
import './home.css';
export default class Reportiop extends Component {
  render() {
    return (
        <div className='cover'>
        <br/><br/>
    <div className='box'>
        <h5 className='center'>Daily Report IOP's</h5>
    <ul>
<li><a target='_blank' href="https://docs.google.com/document/d/1AlvyP35TQQBB5X5DwTCXqKGf0sv956fk/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow - TFG</a></li>
<li><a target='_blank' href="https://docs.google.com/document/d/1y-hJ9z8gJIVYULD5uvgyDr6AMNSjpDj2/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow Massmart</a></li>
<li><a target='_blank' href="https://docs.google.com/document/d/1wMoxyTFfTTf58v81bWQPJsDHLcoTGQdp/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow - Ackermans</a></li>
<li><a target='_blank' href="https://docs.google.com/document/d/1ZLRVjrPE9iJDDgAm7wBmb3tZDjuKGG24/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow - Mr Price</a></li>
<li><a target='_blank' href="https://docs.google.com/document/d/1ZOaH8FZF5aEDmw1KtcLvfXQ4QoaBW4YW/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow - PNP</a></li>
<li><a target='_blank' href="https://docs.google.com/document/d/1oe_EBPCHjK3KwOI-XWwica-YxXO8lDJp/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow - Shoprite</a></li>
<li><a target='_blank' href="https://docs.google.com/document/d/1DMCrrE6G4VWuN2Bim3qeBRXSVnT8LvJi/edit?usp=sharing&ouid=108844464190702674763&rtpof=true&sd=true">Action List workflow - WWZA</a></li>
    </ul>
    </div>
    </div>
    );
  }
}
